INSERT INTO `warn_config` VALUES (1, 'PH', 'PH', '6.5_8.5', '酸性水体会腐蚀设备，碱性水体影响水生生物生长，影响生态系统平衡', '1. 检查并调整水体酸碱度\r\n2. 添加碱性物质如石灰调节\r\n3. 检查是否有酸性废水排放');
INSERT INTO `warn_config` VALUES (2, '溶解氧', 'RJY', '_9', '溶解氧异常会导致水生生物窒息死亡，水体发臭，形成死水区', '1. 增加水体流动和曝气\r\n2. 减少有机污染物排放\r\n3. 控制藻类过度繁殖');
INSERT INTO `warn_config` VALUES (3, '化学需氧量', 'HXXYL', '_3', '化学需氧量表明水体有机污染严重，消耗溶解氧，危害水生生物', '1. 减少有机污染物排放\r\n2. 加强污水处理\r\n3. 增加水体自净能力');
INSERT INTO `warn_config` VALUES (4, '无机氮', 'WJD', '_0.5', '无机氮过高会导致水体富营养化，藻类大量繁殖，破坏生态平衡', '1. 控制农业化肥使用\r\n2. 减少生活污水排放\r\n3. 建设人工湿地净化');
INSERT INTO `warn_config` VALUES (5, '活性磷酸盐', 'HXLSY', '_0.03', '活性磷酸盐过高会导致水体富营养化，引发藻华现象', '1. 控制含磷洗涤剂使用\r\n2. 减少农业磷肥流失\r\n3. 实施磷去除工艺');
INSERT INTO `warn_config` VALUES (6, '石油类', 'SYL', '_0.05', '石油类污染会形成油膜阻碍氧气交换，毒害水生生物，破坏生态环境', '1. 控制石油类污染物排放\r\n2. 设置油水分离设施\r\n3. 使用吸油材料清理');
